  "privacy_content": "<h2>Komunikat o Prywatności</h2><p> Niniejszy komunikat o prywatności ma zastosowanie do korzystania z produktu stowarzyszenia PharmaLedger Association zawierającego elektroniczne informacje o produktach. </p><h2>Dane kontaktowe</h2><p><b>a) Tożsamość i dane kontaktowe administratora lub współadministratorów</b></p><p>Administratorem Twoich danych jest stowarzyszenie PharmaLedger Association.</p><p><b>b) Dane kontaktowe inspektora ochrony danych</b></p><p>Z Biurem Ochrony Danych stowarzyszenia PharmaLedger Association można się skontaktować pod adresem: dpo@pharmaledger.org. </p><h2>Dane osobowe, które wykorzystujemy</h2><p>Gromadzimy wyłącznie dane techniczne niezbędne do dostarczenia ulotki elektronicznej. Obejmuje to Twój adres IP oraz identyfikatory techniczne urządzenia i przeglądarki, z których korzystasz w celu uzyskania dostępu do naszej aplikacji.</p><p><em>Gromadzimy szczegółowo następujące elementy danych:</em></p><ul><li><p><em>Dostęp do urządzenia mobilnego.</em> Możemy poprosić o dostęp lub pozwolenie na korzystanie z niektórych funkcji urządzenia mobilnego, w tym aparatu i innych funkcji. Jeśli chcesz zmienić nasz dostęp lub pozwolenia, możesz to zrobić w ustawieniach swojego urządzenia.</p></li><li><p><em>Dane urządzenia mobilnego.</em> Automatycznie gromadzimy informacje o urządzeniu (takie jak identyfikator urządzenia mobilnego, model i producent), informacje o systemie operacyjnym, wersji i konfiguracji systemu, numery identyfikacyjne urządzenia i aplikacji, informacje o rodzaju i wersji przeglądarki, modelu sprzętu, dostawcy usług internetowych i/lub operatorze komórkowym i adresie protokołu internetowego (IP) (lub serwera proxy). Jeśli korzystasz z naszych aplikacji, możemy również gromadzić informacje o sieci telefonicznej powiązanej z Twoim urządzeniem mobilnym, informacje o systemie operacyjnym lub platformie urządzenia mobilnego, rodzaju urządzenia mobilnego, z którego korzystasz, unikalnym identyfikatorze urządzenia mobilnego oraz informacje o funkcjach naszych aplikacji, do których uzyskałeś dostęp.</p></li></ul><h2>Dlaczego gromadzimy Twoje dane osobowe</h2><p><b>Cele </b></p><p>Gromadzimy Twoje dane techniczne w celu dostarczenia elektronicznej ulotki Twojego produktu leczniczego. </p><p>W związku z tym w celu przetwarzania Twoich danych osobowych możemy powołać się na następujące podstawy prawne:</p><ul><li><p><b>Wykonanie umowy.</b> Przetwarzanie Twoich danych osobowych może nastąpić, gdy uznamy, że jest to niezbędne do wypełnienia zobowiązań umownych, w tym świadczenia Ci naszych Usług lub na Twoją prośbę przed zawarciem umowy.</p></li><li><p><b>Zobowiązania wynikające z przepisów prawa.</b> Przetwarzanie Twoich danych osobowych może nastąpić, jeśli uznamy, że jest to konieczne do wypełnienia naszych zobowiązań wynikających z przepisów prawa, takich jak wypełnienie zobowiązań wynikających z przepisów dotyczących służby zdrowia i przepisów dotyczących zdrowia publicznego.</p></li></ul><h2>Komu udostępniamy Twoje dane osobowe</h2><p>Firmy członkowskie i zewnętrzni dostawcy usług.</p><p>Twoje dane udostępniamy zewnętrznym dostawcom, usługodawcom, wykonawcom lub agentom („stronom trzecim”), którzy świadczą usługi dla nas lub w naszym imieniu i dostęp do takich informacji jest warunkiem wykonania tych usług. Z naszymi stronami trzecimi zawarliśmy umowy mające na celu ochronę Twoich danych osobowych. Oznacza to, że strony te nie mogą rozporządzać Twoimi danymi osobowymi, chyba że na nasze wyraźne polecenie. Nie udostępnią również Twoich danych osobowych żadnej organizacji poza naszą. Zobowiązują się również do ochrony danych, które przechowują w naszym imieniu i przechowywania ich przez wyznaczony przez nas okres. Kategorie stron trzecich, którym możemy udostępniać dane osobowe, są następujące:</p><ul><li><p>Producenci produktów leczniczych (firmy członkowskie)</p></li><li><p>Dostawcy usług technicznych </p></li></ul><h2>Okres przechowywania Twoich danych osobowych</h2><p>Stowarzyszenie PharmaLedger Association przechowuje Twoje dane techniczne tylko przez okres niezbędny do przetworzenia Twojego żądania o ulotkę, do 30 dni. </p><p>Producent produktu leczniczego również przechowuje Twoje dane przez określony czas ustalony w jego zasadach przechowywania danych. Aby uzyskać więcej informacji na ten temat, skontaktuj się z producentem produktu leczniczego.</p><h2>Odmowa dostarczenia danych osobowych</h2><p>Jeśli zdecydujesz się nie udostępniać nam swoich danych technicznych, nie będziemy mogli przetworzyć Twojego żądania o ulotkę.</p><h2>Przysługujące Ci prawa</h2><p>W razie jakichkolwiek żądań związanych z Twoimi danymi osobowymi wynikających z rozporządzenia RODO, jak żądanie dostępu do Twoich danych lub ich usunięcia, możesz skontaktować się z nami pod adresem: dpo@pharmaledger.org. </p><p>Wspomniane żądanie przetworzymy w ciągu 30 dni.</p><h2>Wycofanie zgody</h2><p>W razie jakichkolwiek żądań związanych z Twoimi danymi osobowymi wynikających z rozporządzenia RODO, jak żądanie dostępu do Twoich danych lub ich usunięcia, możesz skontaktować się z nami pod adresem: dpo@pharmaledger.org. </p><p>Wspomniane żądanie przetworzymy w ciągu 30 dni.</p><h2>Zautomatyzowany proces podejmowania decyzji</h2><p>Podczas świadczenia usług nie korzystamy z opcji zautomatyzowanego procesu podejmowania decyzji.</p><h2>Międzynarodowy transfer danych osobowych</h2><p>Jeżeli producent produktu leczniczego wymaga od nas przesłania Twoich danych poza Unię Europejską, stosujemy standardowe klauzule umowne w celu ochrony Twoich danych.</p><h2>Składanie zażaleń</h2><p>W razie jakichkolwiek żądań związanych z Twoimi danymi osobowymi wynikających z rozporządzenia RODO, jak żądanie dostępu do Twoich danych lub ich usunięcia, możesz skontaktować się z nami pod adresem: dpo@pharmaledger.org. </p><p>Wspomniane żądanie przetworzymy w ciągu 30 dni. Jeśli podejrzewasz naruszenie swoich praw możesz również skontaktować się z lokalnym organem nadzorczym.</p>",
  "terms_modal_title": "Regulamin",
