  "terms_content": "<h2>Regulamin korzystania ze strony internetowej i aplikacji stowarzyszenia PharmaLedger Association zawierającej elektroniczne informacje o produktach</h2><p>Uzyskując dostęp lub korzystając ze strony internetowej i aplikacji stowarzyszenia PharmaLedger Association zawierającej elektroniczne informacje o produktach („Usługi”), wyrażasz zgodę na przestrzeganie niniejszego Regulaminu („Regulamin”). Jeśli nie zgadzasz się z niniejszym Regulaminem, zarówno dostęp do Usług, jak i ich wykorzystanie będą niemożliwe. Usługi są dostarczane przez stowarzyszenie PharmaLedger Association („Stowarzyszenie”) i są przeznaczone do użytku przez osoby fizyczne poszukujące informacji na temat swoich leków. Sieć wielopodmiotowa świadczy Usługi, a producent produktów leczniczych dostarcza informacje o produkcie wyświetlane za pośrednictwem Usług. Stowarzyszenie pełni rolę administratora danych w odniesieniu do tych informacji. </p><h2>Korzystanie z Usług </h2><p>Zgadzasz się korzystać z Usług wyłącznie w celach zgodnych z prawem i w sposób nienaruszający praw, nieograniczający lub nieutrudniający korzystania z Usług przez jakąkolwiek osobę trzecią. Takie ograniczenie lub utrudnienie obejmuje między innymi postępowanie niezgodne z prawem lub noszące znamiona nękania lub powodujące niepokój lub niedogodności dla jakiejkolwiek osoby, a także przesyłanie nieprzyzwoitych lub obraźliwych treści lub zakłócanie normalnego dialogu w Usługach. </p><h2>Własność intelektualna</h2><p>Treść Usług, w tym między innymi tekst, grafika, obrazy i oprogramowanie, jest własnością Stowarzyszenia lub jego licencjodawców i firm członkowskich i jest chroniona prawem autorskim i innymi prawami własności intelektualnej. Zabrania się wykorzystywania wszelkich treści pochodzących z Usług w celach komercyjnych bez wyraźnej pisemnej zgody Stowarzyszenia.</p><h2>Odpowiedzialność</h2><p>Stowarzyszenie nie składa żadnych oświadczeń ani jakichkolwiek zapewnień, wyraźnych lub dorozumianych, co do działania Usług lub informacji, treści, materiałów lub produktów zawartych w Usługach. Stowarzyszenie nie ponosi odpowiedzialności za żadne szkody powstałe w wyniku korzystania z Usług, w tym między innymi za szkody bezpośrednie, pośrednie, przypadkowe, karne i wtórne. </p><h2>Obowiązujące prawo </h2><p>Niniejszy Regulamin i korzystanie z Usług będą regulowane i interpretowane zgodnie z prawem szwajcarskim, a wszelkie spory będą rozstrzygane przez sądy w Bazylei w Szwajcarii.</p><h2>Zmiany w Regulaminie </h2><p>Stowarzyszenie zastrzega sobie prawo do wprowadzania zmian w niniejszym Regulaminie w dowolnym momencie, a odpowiedzialność za okresowe sprawdzanie niniejszego Regulaminu pod kątem jakichkolwiek zmian należy do Ciebie. Dalsze korzystanie z Usług po wprowadzeniu jakichkolwiek zmian w Regulaminie będzie równoznaczne z akceptacją zmienionego Regulaminu.</p><p><br></p>",
