  "about_modal_title": "PharmaLedger",
  "about_content": "<h2>Informacje o aplikacji</h2><p>Niniejsza aplikacja została dostarczona przez PharmaLedger®. Jest wynikiem współpracy organizacji reprezentujących pacjentów, firm farmaceutycznych i ekspertów w dziedzinie technologii.</p><p>Aplikacja umożliwia użytkownikom przeglądanie informacji o ich leku po zeskanowaniu kodu znajdującego się na opakowaniu produktu.</p><p>Wyświetlane informacje pochodzą od posiadacza pozwolenia na dopuszczenie produktu do obrotu.</p><h2>Informacje o PharmaLedger</h2><p>PharmaLedger® jest marką stowarzyszenia PharmaLedger Association (PLA).</p><p>PLA jest globalnym, neutralnym stowarzyszeniem non-profit. Celem stowarzyszenia jest tworzenie i promowanie cyfrowego ekosystemu zaufania w służbie zdrowia.</p><p>Stowarzyszenie wspiera współpracę w sektorach służby zdrowia i nauk przyrodniczych oraz promuje innowacje i ich wdrażanie dla obopólnej korzyści pacjentów i innych zainteresowanych.</p>",
  "help_modal_title": "Pomoc",
  "help_modal_subtitle": "Najczęściej zadawane pytania",
  "help_content": "<div><p><b><h2>Czym jest EPI?</h2></b></p><p>    <b>EPI</b> to w skrócie <b>elektroniczne informacje o produkcie</b> (z ang. electronic product information). Jest to elektroniczna wersja\npapierowej ulotki dla pacjenta z informacjami o produkcie, którą zwykle można znaleźć w opakowaniu produktu leczniczego. W niektórych przypadkach <b>EPI</b> mogło zastąpić ulotkę papierową.</p><p>    <b><h2>Czym jest PharmaLedger?</h2></b></p><p>PharmaLedger Association (PLA) to stowarzyszenie non-profit z siedzibą w Szwajcarii, którego celem jest umożliwienie i wspieranie cyfrowego ekosystemu zaufania w służbie zdrowia za pośrednictwem ustandaryzowanej i zaufanej platformy typu open source. Stowarzyszenie PLA promuje współpracę oraz przyspiesza innowacje i ich wdrażanie w celu osiągnięcia wzajemnych korzyści w dziedzinie służby zdrowia i nauk przyrodniczych dla pacjentów i innych zainteresowanych. Stowarzyszenie PLA powstało w 2022 roku jako kontynuacja pracy nad projektem PharmaLedger, 3-letnim projektem finansowanym przez Komisję Europejską i przemysł farmaceutyczny, mającym na celu udowodnienie wartości rozwiązań blockchain. Więcej informacji można uzyskać pod adresem https://pharmaledger.org</p><p><b><h2>Czym jest DataMatrix?</h2></b></p><p>Jest to rodzaj kodu kreskowego na opakowaniu produktu. Jest to czarno-biały, kwadratowy kod kreskowy, podobny do poniższego:<br>    <img src=\"./images/barcode_example.png\" alt='DataMatrix'></p><p>    <b><h2>Jak korzystać z aplikacji?</h2></b></p><p>    Postępuj zgodnie z instrukcjami na stronie startowej aplikacji, gdzie na zdjęciu pokazane jest, jak odnaleźć kod Data Matrix na opakowaniu produktu leczniczego. Po znalezieniu kodu     <b>DataMatrix</b> kliknij przycisk „Skanuj kod <b>DataMatrix</b>”. Zezwól aplikacji na korzystanie z aparatu, aby umożliwić zeskanowanie kodu <b>DataMatrix</b>. Użyj aparatu, aby dostosować ostrość kodu <b>DataMatrix</b>. Po pomyślnym zeskanowaniu kodu z opakowania wyświetli się <b>EPI</b> Możesz kliknąć przycisk „+”, aby uzyskać więcej szczegółów.</p><p><b><h2>Dlaczego mój skan kodu DataMatrix nie wyświetla wyników?</h2></b></p><p>    Jest kilka powodów, dla których skanowanie kodu <b>DataMatrix</b> na opakowaniu produktu leczniczego nie skutkuje wyświetleniem EPI. Jednym z nich może być zła ostrość obrazu. Spróbuj zeskanować kod w dobrze oświetlonym miejscu, tak aby był on dobrze widoczny na ekranie. Jeśli utrzymanie ręki w pozycji nieruchomej stanowi trudność, spróbuj użyć stołu w celu stabilizacji dłoni.</p></div>",
